import React, { Component } from 'react'
import ProfileBox from '../ProfileBox/ProfileBox';

import aero1 from './../../img/aerodynamics/1.png';
import aero2 from './../../img/aerodynamics/2.png';
import aero3 from './../../img/aerodynamics/3.png';
import aero4 from './../../img/aerodynamics/4.png';

import './Aerodynamics.css';

export class Aerodynamics extends Component {
    render() {
        return (
            <div>
                <ProfileBox />

                <div className="aerodynamic-showcase">
                    <img className="aeropack-1" src={aero1}></img>
                </div>



            </div>
        )
    }
}

export default Aerodynamics
